import { Component, Input } from '@angular/core';
import { Url } from '../shared/url';

@Component({
  selector: 'app-url',
  templateUrl: './url.component.html',
  styleUrls: ['./url.component.css']
})
export class UrlComponent {
  @Input() url: Url = {} as Url;
}
